import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    
    return (
        <ul>
            <li>Learn React</li>
            <li>Build Awesome App</li>
        </ul>
    );
}

const AppHeader = () => {
    return <h1>It's my Todo List</h1>
}

const SearchPanel = () => {
    return <input placeholder="search" />
}

const App = () => {
    return (
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
            <Footer />
        </div>
    )
}
const Footer = () => React.createElement('footer', null, '© Copyright Matthew Farrel Corporation')

console.log(<TodoList />);
console.log(<App />);
ReactDOM.render(<App />, document.getElementById('root'));
